INSERT INTO `features` (`id`, `is_deleted`, `group_id`, `title`, `description`, `filepath`, `last_run`, `status`, `last_message`, `deleted`, `file_modify`, `db_modify`) VALUES
(1, 0, 1, 'Авторизация бля', '# encoding: utf-8\n# language: ru\nФункция: Авторизация\n	Для того, чтобы пользоваться ресурсом\n	я как пользователь\n	хочу зайти на сайт со своим логином и паролем...\n\n	Сценарий: Успешная авторизация\n		Допустим я вошел\n		Then I should be logged in\n\n	Сценарий: Попытка войти с неправильный паролем\n		When I log in with wrong password\n		Then I should not be logged in\n		And I should see wrong password message', 'sign_in', 1322472975, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n2 scenarios (2 passed)\n7 steps (7 passed)\n0m12.894s', 0, 1320655502, 1320312907),
(3, 0, 0, 'подтверждение почты', '234', 'confirmation', 1321465092, 4, 'no file ../features//confirmation.feature', 1, 0, 0),
(7, 0, 3, 'Добавление/удаление книг на полках', '# encoding: utf-8\n# language: ru\n\nФункция: Добавление/удаление книг на полках\nЛюбой юзер может добавить любую доступную ему книгу на одну из своих полок (читал, читаю, буду читать),где их увидят другие пользователи.И обратно – с любой полки любую книгу любой юзер может удалить.\n\n Предыстория:\n    Допустим я вошёл как читатель\n    \n  Сценарий: Добавляем книгу на полку\n    Если я добавил книгу\n    И я добавил книгу на полку Я читал\n    То книга должна быть на полке Я читал', 'polki', 1322462786, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.....\n\n1 scenario (1 passed)\n4 steps (4 passed)\n0m4.332s', 0, 1321005872, 1320673011),
(9, 0, 2, 'Добавление книги', '# encoding: utf-8\n# language: ru\nФункция: Добавление книги\n  Чтобы приобщиться к созданию крупнейшей электронной библиотеки и получить абонемент\n  я как читатель\n  хочу добавлять карточки книжек с описанием\n\n  Предыстория:\n    Допустим я вошёл как читатель\n	\n  Сценарий: Успешное добавление кгиги\n    Если я добавил книгу\n    То я должен увидеть добавленную книгу\n\n  Сценарий: Добавление книги без названия\n    Если я добавляю книгу без названия\n    То книга не должна добавиться\n    А я должен увидеть сообщение, что нельзя добавлять книги без названия\n\n  Сценарий: Добавление книги без языка\n    Если я добавляю книгу без языка\n    То книга не должна добавиться\n    А я должен увидеть сообщение, что нельзя добавлять книги без языка\n\n  Сценарий: Вандал пытается добавить книгу\n    Допустим я вандал\n    Если я добавляю книгу\n    То книга не должна добавиться\n    А я должен увидеть сообщение, что нахуй я иду с такими заявами', 'add_book', 1322477123, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....--.....\n\n4 scenarios (4 passed)\n12 steps (12 passed)\n0m8.915s', 0, 1321372061, 1320659143),
(10, 0, 1, 'Регистрация пользователя 1', '# encoding: utf-8\n# language: ru\nФункция: Регистрация пользователя\n  Чтобы добавлять, качать и добавлять книги на полки\n  я как обычный юзер интернетов\n  хочу зарегистрироваться на Либрусеке\n\n  Сценарий: Успешная регистрация\n    Если я зарегистрируюсь\n    То моя учетная запись должна быть создана\n    И должен оказаться на моей личной странице\n\n  Сценарий: Регистрация с emai-ом, который уже есть в базе\n    Если я зерегистрируюсь с неуникальным email-ом\n    То моя учетная запись не должна быть создана\n    А мне должны показать сообщение о том, что такой email уже есть', 'sign_up', 1322472021, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.....\n\n2 scenarios (2 passed)\n5 steps (5 passed)\n0m9.461s', 0, 1321005762, 1320318024),
