(16, 0, 1, 'Подтверждение почтового ящика', '# encoding: utf-8\n# language: ru\n\n@wip\nФункция: Подтверждение почтового ящика\n  В базе есть /неподтвержденный читатель/, переход по ссылке для активации (которая шлется на мэйл) превращает этого юзера в /читателя/.\n\n  Сценарий: Успешное подтверждение\n    Допустим в базе есть неподтвержденный пользователь\n    Если я захожу на страницу подтверждения регистрации\n    То пользователь должен стать читателем', 'email_confirm', 1322472985, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m6.659s', 0, 1321005743, 1320656508),
(18, 0, 1, 'Восстановление пароля', 'Если юзер забыл пароль, то при вводе актуального мэйла в базе ему высылается ссылка на восстановление пароля.\r\nПри переходе по этой ссылке он должен мочь ввести и подтвердить новый пароль.\r\nЕсли пароль подтвержден правильно, он теперь может залогиниться по нему.', 'password_recovery', 1321606887, 4, 'no scenarios in file ../features/authorization/password_recovery.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1321005039, 0),
(19, 0, 1, 'Смена ника', '# encoding: utf-8\n# language: ru\n\n@wip\nФункция: Смена ника\n  Пользователь может только один раз сменить свой ник.\n  Ник должен быть уникальным. \n  Урл доступа к профилю юзера меняется соответственно.\n\n  Предыстория:\n    Допустим я — пользователь, который ни разу не менял свой ник\n    И я вошёл в систему\n    \n  Сценарий: Пользователь меняет ник\n    Если я поменял свой ник\n    То мой ник должен измениться\n\n  Сценарий: Пользователь меняет ник второй раз\n    Если я поменял свой ник два раза\n    То мой ник не должен измениться\n    А я должен увидеть сообщение, что два раза ник менять нельзя', 'nick_update', 1321606890, 4, 'no scenarios in file ../features/authorization/nick_update.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1322213120, 1322213120),
(20, 0, 1, 'Сохранение сессии', '# encoding: utf-8\n# language: ru\n\nФункция: Сохранение сессии\nНа ближайшее будущее: В базе должна запоминаться информация о последнем логине пользователя, эта информация должна быть доступна пользователю где-нибудь глубоко в профиле.\nПо умолчанию авторизованный пользователь запоминается на N дней на данной машине.', 'auth_sessions', 1321606893, 4, 'no scenarios in file ../features/authorization/auth_sessions.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1322212370, 1322212370),
(21, 0, 8, 'Смена ролей', '# encoding: utf-8\n# language: ru\n\nФункция: Смена ролей\n  Админ может сделать любого юзера Вандалом, Бибером, Читателем.\n  Бибер может сделать любого пользователя, кроме Админа и Бибера – Читателем или Вандалом.\n  Никто не может изменить собственную роль.\n  Читатель и ниже не может менять ничьи роли.\n\n Предыстория:\n    Допустим я вошёл как библиотекарь\n    Допустим в базе есть друг читатель\n\n  Сценарий: Смена роли читателя на вандала\n    Если я сделал друга вандалом\n    То друг должен стать вандалом\n    \n  Сценарий: Смена роли читателя на библиотекаря\n    Допустим я вошёл как администратор\n    Если я сделал друга библиотекарем\n    То друг должен стать библиотекарем', 'role_change', 1322478714, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....---....................................--....\n\n17 scenarios (17 passed)\n48 steps (48 passed)\n0m18.859s', 0, 1321360518, 1320749142),
(23, 0, 8, 'Админ меняет роль пользователя', 'Админ может редактировать профили пользователей и менять их роли', 'admin_changes_role', 1321465088, 4, 'no file ../features/roles/admin_changes_role.feature', 1, 0, 0),
(25, 0, 3, 'Добавление/удаление автора/серию/жанр в любимые', '# encoding: utf-8\n# language: ru\n\nФункция: Добавление/удаление автора/серию/жанр в любимые\nЛюбого автора/серию/жанр любой юзер может "добавить в"/"удалить из любимых".\nПри этом на странице автора меняется счетчик и на соотв. странице список "этот автор/серия/жанр в любимых у..."\nА у юзера в профиле появляется или исчезает соотв. информация.\nНо самое важное – юзеры должны видеть в своей ленте новые поступления этого автора/серии/жанра (как если бы этот автор/серия/жанр был их другом).\nПричем туда должны попадать только новые добавления книг (создание карточек или добавление файла к карточке без файла).\n\n Предыстория:\n    Допустим я вошёл как библиотекарь\n    \n  Сценарий: Добавляем серию в любимые\n    Если я добавил серию\n    И я добавил серию в любимые\n    То серия должна быть в любимых\n  \n  Сценарий: Добавляем автора в любимые\n    Если я добавил автора\n    И я добавил автора в любимые\n    То автор должен быть в любимых\n    \n  Сценарий: Добавляем жанр в любимые\n    Если я добавил жанр в любимые\n    То жанр должен быть в любимых', 'favorites_asg', 1322462842, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n............\n\n3 scenarios (3 passed)\n11 steps (11 passed)\n0m9.309s', 0, 1321005872, 1320679237),
(26, 0, 3, 'Любимые книги', 'При добавлении любым юзером книги в любимые эта книга попадает к нему в профиль, \r\nсоздается рецензия с оценкой 5 и флажком "любимая", \r\nна стене юзера создается событие такое же, как при рецензии, но с другим оформлением: не "юзер оценил книгу на 5", а "юзер добавил книгу в любимые".\r\n\r\nПри удалении книги из любимых, рецензия и оценка остается, но не поднимается наверх в лентах.', 'favorite_book', 1322462846, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n......\n\n1 scenario (1 passed)\n4 steps (4 passed)\n0m1.433s', 0, 1321014687, 0),
