(36, 0, 8, 'Бибер деалает вандалом', '# encoding: utf-8\n# language: ru\n\nФункция: Сделать вандалом\n  Админ может сделать любого юзера Вандалом, Бибером, Читателем.\n  Бибер может сделать любого пользователя, кроме Админа и Бибера – Читателем или Вандалом.\n \n Предыстория:\n    Допустим я вошёл как библиотекарь\n    Допустим в базе есть друг читатель\n\n  Сценарий: Смена роли читателя на вандала\n    Если я сделал друга вандалом\n    То друг должен стать вандалом', 'biber_makes_vandal', 1322469213, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.....--..\n\n3 scenarios (3 passed)\n10 steps (10 passed)\n0m5.897s', 0, 1321286716, 1320749812),
(37, 0, 8, 'Бибер смотрит вклад пользователя', 'Бибер и выше могут смотреть изменения книжного фонда, сделанные пользователем, чтобы иметь возможность откатить говно.', 'biber_user_log', 1322467352, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.......\n\n1 scenario (1 passed)\n6 steps (6 passed)\n0m2.568s', 0, 1321018224, 0),
