(39, 0, 8, 'Бибер смотрит изменения автора', 'Бибер и выше могут смотреть изменения конкретного автора, сделанные всеми пользователями, чтобы иметь возможность откатить говно.', 'biber_author_log', 1322475348, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..............................\n\n4 scenarios (4 passed)\n29 steps (29 passed)\n0m13.000s', 0, 1321005868, 0),
(40, 0, 8, 'Бибер смотрит изменения серии', 'Бибер и выше могут смотреть изменения конкретной серии, сделанные всеми пользователями, чтобы иметь возможность откатить говно.', 'biber_serie_log', 1322467413, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..............................\n\n4 scenarios (4 passed)\n29 steps (29 passed)\n0m8.637s', 0, 1321437630, 0),
(41, 0, 8, 'Откат/накат изменения', 'Бибер и выше в любом из логов могут откатить одно (несколько) изменений или вернуть их результат обратно.\r\nЗдесь нужно прогнать список всех возможных изменений для книги, серии, автора, журнала. В том числе склейка серий и привязка/отвязка редакций и дубликатов.', 'biber_undo', 1321465100, 4, 'no file ../features/roles/biber_undo.feature', 1, 1321005868, 0),
(42, 0, 8, 'Оценка качества файла', 'Бибер (админ) может поставить файлу оценку больше 4, чтобы юзеры не могли засрать нормальную книжку.', 'biber_rate_book', 1322483060, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....\n\n1 scenario (1 passed)\n4 steps (4 passed)\n0m1.912s', 0, 1321005868, 0),
(43, 0, 2, 'Добавление автора', 'Чтобы пополнять список авторов на Либрусеке, пользователь может добавить автора в систему, указав его Ф.И.О., годы жизни и биографию.', 'add_author', 1322477133, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....--.....\n\n4 scenarios (4 passed)\n12 steps (12 passed)\n0m7.161s', 0, 1321372904, 0),
(44, 0, 2, 'Добавление автора к книге', 'Чтобы указать полную информацию о книге, пользователь может добавить какого-нибудь автора в качестве автора (редактора, переводчика, иллюстратора) какой-то книги', 'add_author_to_book', 1322467293, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m4.273s', 0, 1321005699, 0),
(45, 0, 3, 'Добавление в друзья', '# encoding: utf-8\n# language: ru\nФункция: Добавление в друзья\nЛюбой пользователь, кроме вандала может добавить любого другого, кроме вандала в друзья.\nПри этом в профиле юзера добавленные пользователи становятся "Друзьями", а тот, кто добавлял в профиле тех, кого добавляли появляется в списке "В друзьях у".\nВзаимные друзья отображаются друг у друга в списке "Друзья".\nПри этом один юзер должен отображаться только один раз в списке "Друзья" или "В друзьях у".\nУдаление из друзей приводит к обратному – расфрендовывание в одну и в обе стороны.\n\n Предыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n    \n  Сценарий: Добавляем друга\n    Если я добавляю друга в друзья\n    То я у должен быть друга в поклонниках\n    И друг должен быть у меня в друзьях', 'add_friends', 1322462855, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...........\n\n2 scenarios (2 passed)\n9 steps (9 passed)\n0m6.200s', 0, 1322123134, 1320739193),
(46, 0, 3, 'Черный список: настройка', '# encoding: utf-8\n# language: ru\n\nФункция: Черный список: настройка\n\nУ любого пользователя есть страница, где он может добавлять любого другого в черный список по id или нику. Включать/выключать этот список и удалять из него людей.', 'black_list_setup', 1321864632, 4, 'no scenarios in file ../features/social/black_list_setup.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1321369044, 1321369044),
(47, 0, 3, 'Черный список: работа', '# encoding: utf-8\n# language: ru\n\nФункция: Черный список: работа\nИз поля зрения залогиненного юзера пропадают или заменяются заглушкой типа "это от black user-а, показать?" след. объекты очерненных юзеров:\nрецензии, посты и события в любых лентах; комментарии к постам, рецензиям, событиям в лентах.\n\nТакже очерненный юзер не может отправить личное сообщение своему недругу.', 'black_list_action', 1321864636, 4, 'no scenarios in file ../features/social/black_list_action.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1321369058, 1321369058),
