(49, 0, 2, 'Добавление серии', 'Пользователь может создать серию и добавить к ней описание, чтобы было понятно, как сгруппированы книги в серии.', 'add_serie', 1322467300, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..........\n\n3 scenarios (3 passed)\n9 steps (9 passed)\n0m4.904s', 0, 1321363349, 0),
(50, 0, 2, 'Добавить книгу в серию', 'Чтобы группировать книги, пользователь может добавлять книги в серии', 'add_serie_to_book', 1322467305, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m1.516s', 0, 1321005772, 0),
(51, 0, 3, 'Личные сообщения', 'Любой юзер, кроме Вандала, может отправить любому юзеру сообщение: одному или нескольким сразу.\r\n\r\nКаждый из адресатов получает во входящие топик, где они продолжают переписку.\r\n\r\nНовые, еще не открытые сообщения выделяются и счетчик непрочитанных увеличивается.\r\n\r\nКаждый может удалить сообщение или всю переписку из входящих. У остальных адресатов переписка и возможность продолжить разговор остается.', 'pm', 1322473396, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...................................\n\n6 scenarios (6 passed)\n32 steps (32 passed)\n0m18.779s', 0, 1322228222, 0),
(52, 0, 2, 'Добавить жанр к книге', 'Для указания информации о книгах, и для удобного поиска книг (например, по жанрам), пользователи могут указывать жанр для книг.', 'add_genre_to_book', 1322467309, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n......\n\n1 scenario (1 passed)\n4 steps (4 passed)\n0m1.511s', 0, 1321007686, 0),
(53, 0, 2, 'Дубликаты и редакции', 'Чтобы не плодить на Либрусеке сотни абсолютно одинаковых книг, читатели могут указывать дубликаты для книжек и редакции.', 'add_relation_to_book', 1322467313, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m1.480s', 0, 1321005730, 0),
(54, 0, 8, 'Вандал не может', 'Вандал не может:\n– оставлять комментарии или лайки\n– абьюзить объекты и юзеров', 'vandal_cant', 1321465102, 4, 'no file ../features/roles/vandal_cant.feature', 1, 1321362955, 1321362955),
(55, 0, 2, 'Отображение книги', 'На странице книги для всех юзеров (и анонимных) отображаются связанные с ней книги, автор, аннотация, рецензии на эту книгу, жанры этой книги, серии (если книга состоит в сериях), ссылки на файлы (если есть файлы), ссылка на страницу редактирования книги, и на страницу координации работы над книгой.\r\n\r\nДля биберов отображается лента служебного обсуждения книги.', 'book_view', 1322473511, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m0.722s', 0, 1321011075, 0),
(56, 0, 2, 'Редактирование  жанра', 'Чтобы объяснить людям, что это за жанр и чего от него стоит ожидать, пользователи могут редактировать описание жанра, добавлять в него картинки.', 'edit_genre', 1322473248, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m3.519s', 0, 1321262553, 0),
(58, 0, 2, 'Редактирование книги', 'Пользователи кроме вандалов могут редактировать книгу в соответствии с ее качеством:\r\n1,2,3 – любые правки (файлы, метаинформация)\r\n4 –  все, кроме биберов, могут заливать только FB2, обложку и править всю метаинфу, кроме названия, жанра, писателя\r\n5 – править всё могут только биберы\r\n\r\nБиберы и выше могут вносить любые правки, в т. ч. менять качество файла.\r\n\r\nЛюбая правка должна отражаться в биберском логе этой книги.', 'edit_book', 1322467326, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.........\n\n2 scenarios (2 passed)\n8 steps (8 passed)\n0m5.318s', 0, 1321445504, 0),
(59, 0, 2, 'Редактирование автора', '# encoding: utf-8\n# language: ru\n\nФункция: Редактирование автора\n  Пользователи кроме вандалов\n  могут редактировать автора, изменять его метаинформацию и редактировать библиографию.\n\n	Любая правка должна отражаться в биберском логе этого автора.\n\n  Сценарий: Редактирование автора\n    Допустим в базе есть автор\n    И я вошёл как библиотекарь\n    Если я редактирую автора\n    То я должен увидеть отредактированного автора\n\n  Сценарий: Вандал редактирует автора\n    Если я вошёл как вандал\n    То я не могу редактировать авторов', 'edit_author', 1322474283, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n......\n\n2 scenarios (2 passed)\n6 steps (6 passed)\n0m8.487s', 0, 1321264103, 1321264103),
(60, 0, 2, 'Редактирование серии', 'Пользователи кроме вандалов могут редактировать серию: метаинформацию и состав серии, а также склеивать серии.\r\n\r\nЛюбая правка должна отражаться в биберском логе этой серии.', 'edit_series', 1322469016, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..........\n\n2 scenarios (2 passed)\n8 steps (8 passed)\n0m7.465s', 0, 1321262650, 0),
(61, 0, 3, 'Рецензии на книгу', 'Любые юзеры, кроме вандалов могут добавлять к книге рецензию.\r\n\r\nРецензия должна появлятся на странице книги, любой другой пользователь может ее на этой странице залайкать: тогда увеличивается счетчик лайков и рецензия попадает в ленту юзера, создается страница рецензии.', 'review', 1322462897, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..............\n\n3 scenarios (3 passed)\n12 steps (12 passed)\n0m9.295s', 0, 1321365212, 0),
(62, 0, 2, 'Отображение серии', 'На странице серии для всех юзеров (и анонимных) отображается описание серии, название и список книг в этой серии.', 'series_view', 1322469020, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m0.913s', 0, 1321005839, 0),
(63, 0, 2, 'Отображение жанров', 'На странице жанра отображается метаинформация о жанре, поджанры или наджанр и список книг в этом жанре.', 'genre_view', 1322469693, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m3.655s', 0, 1321011391, 0),
(64, 0, 2, 'Отображение автора', 'На странице автора для всех юзеров (и анонимных) отображается описание автора, ссылка на клонов автора и его библиография.', 'author_view', 1322469697, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...\n\n1 scenario (1 passed)\n3 steps (3 passed)\n0m0.730s', 0, 1321005776, 0),
(66, 0, 10, 'Создание рецензии', '# encoding: utf-8\n# language: ru\nФункция: Создание рецензии\nЛюбой (только залогиненный) юзер кроме вандала:\n\n- создает рецензию на книгу со страницы книги с текстом -> в его личной ленте и лентах всех, кто его френдит, появляется соотв. объект с текстом рецензии и/или оценкой и пометкой любимые (всего 4 типа рецензии: влюбимые, текст, оценка и текст с оценкой)\n\n- созданные объекты могут лайкать и комментировать как друзья, так и недрузья юзера, лайки и комменты обновляются в лентах всех этих юзеров.\n\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: создание рецензии\n		Если я создаю рецензию к книге\n		То у друга на стене появляется рецензия', 'review_post', 1322463812, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..........\n\n1 scenario (1 passed)\n6 steps (6 passed)\n0m6.853s', 0, 1321005863, 1320760706),
(67, 0, 10, 'Создание поста', '# encoding: utf-8\n# language: ru\nФункция: Создание поста\nВ интерфейсе залогиненного юзера есть возможность создать пост-статус.\n\nПри создании поста-статуса создается объект в личной ленте и лентах всех друзей юзера с текстом.\n\nКомментарии при этом только одноуровневые, отображаются в лентах (последние N комментариев) и на странице этого поста по адресу /post/:id\n\n\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: создание рецензии\n		Если я создаю короткий пост\n		То у друга на стене появляется пост', 'status_post', 1322463819, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m4.132s', 0, 1322146216, 1320760736),
(68, 0, 10, 'Пост длинный текст', '# encoding: utf-8\n# language: ru\nФункция: Пост длинный текст\nУ залогиненного юзера в интерфейсе есть возможность создать "длинный" пост, с форматированием большой длины.\n\nВоспользовавшись этой возможностью юзер создает пост, который доступен полностью по своему урлу /post/:id, а в ленте (его и друзей) появляется объект со снипетом этого поста.\n\nКомментарии к постам двухуровневые, могут оставлять любые залогиненные юзеры, кроме вандалов.\n\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: создание рецензии\n		Если я создаю длинный пост\n		То у друга на стене появляется длинный пост', 'rich_text_post', 1322463835, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m6.212s', 0, 1321005863, 1320846590),
(69, 0, 10, 'События: книга на полке', '# encoding: utf-8\n# language: ru\nФункция: События: книга на полке\nЛюбой залогиненный может добавить книгу на одну из трех полок.\nПри этом в его и его друзей ленты попадает от его имени сообщение об этом.\n \nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n    \nСценарий: добавление книги на полку\n	Если я добавил книгу на полку\n	То на стене друга появится запись о добавлении книги на полку\n	И на стене у меня появится запись о добавлении книги на полку', 'event_bookshelf', 1322464050, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...........\n\n1 scenario (1 passed)\n7 steps (7 passed)\n0m4.130s', 0, 1321005863, 1320763200),
(70, 0, 10, 'События: добавил книгу/автора/серию', '# encoding: utf-8\n# language: ru\n\nФункция: События: добавил книгу/автора/серию\nЛюбой залогиненный, кроме вандала может завести новую карточку книги/автора/серии.\n\nВ его ленте появляется соотв. событие.\n\nСобытие содержит соотв. снипет автора/книги/серии.  \n    \nСценарий: добавление книги\n Допустим я вошёл как читатель\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n	Если я добавил книгу\n	То на стене друга появится запись о добавлении новой книги\n	И на стене у меня появится запись о добавлении новой книги\n	\nСценарий: добавление автора\n Допустим я вошёл как читатель\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n	Если я добавил автора\n	То на стене друга появится запись о добавлении нового автора\n	И на стене у меня появится запись о добавлении нового автора\n	\nСценарий: добавление серии\n Допустим я вошёл как библиотекарь\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у библиотекаря в поклонниках\n	Если я добавил серию\n	То на стене друга появится запись о добавлении новой серии\n	И на стене у меня появится запись о добавлении новой серии', 'add_book_event', 1322464012, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.....................\n\n3 scenarios (3 passed)\n21 steps (21 passed)\n0m19.980s', 0, 1321368998, 1321368998),
(71, 0, 10, 'События: загрузка книги', '# encoding: utf-8\n# language: ru\n\nФункция: События: загрузка файла книги\nЛюбой, кроме вандала может загрузить книгу к существующей карточке в одном из разрешенных форматов.\nОб этом создается в лентах соотв. событие, кот. можно лайкать и комментировать.\n\nВ событии содержится ссылка на книгу и на скачку загруженного файла.', 'upload_book_event', 1322147756, 4, 'no scenarios in file ../features/feeds/upload_book_event.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1322148043, 1322148043),
(72, 0, 10, 'События: правка книги', '# encoding: utf-8\n# language: ru\nФункция: События: правка книги\nЛюбой, кроме вандала может править метаинформацию книги. \nОб этом создается в лентах соотв. событие, кот. можно лайкать и комментировать.\nВ событии содержится ссылка-снипет книги.\n\n\n\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: редактирование книги\n		Если я редактирую книгу\n		То у друга на стене появляется событие о редактировании книги', 'edit_book_event', 1322464019, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..........\n\n1 scenario (1 passed)\n6 steps (6 passed)\n0m3.594s', 0, 1321005863, 1320826224),
(73, 0, 10, 'События: Получение медали', '# encoding: utf-8\n# language: ru\n\nФункция: События: Получение медали', 'medals_event', 1322146960, 4, 'no scenarios in file ../features/feeds/medals_event.feature\n\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n\n\n0 scenarios\n0 steps\n0m0.000s', 0, 1321369119, 1321369119),
(74, 0, 10, 'donotouchme', 'donotouchme donotouchme donotouchme donotouchme donotouchme donotouchme donotouchme donotouchme donotouchme donotouchme', 'donotouchme', 1321465094, 4, 'no file ../features/feeds/donotouchme.feature', 1, 0, 0),
(75, 0, 10, 'События: френдование', '# encoding: utf-8\n# language: ru\nФункция: События: френдование\nКогда один юзер френдит другого на его ленте и его друзьям попадает событие об этом.\nСобытие содержит инфу о том кто кого френдит и не должно попадать к тому, кого френдят.\nЕсли тот, кого френдят, ответит взаимностью – в его ленте создастся аналогичное событие.\n\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n\nСценарий: френдование\n	  Если я добавляю друга в друзья\n    То я у должен быть друга в поклонниках\n    И друг должен быть у меня в друзьях\n    И у меня на стене должна появиться запись о добавлении в друзья', 'add_friend_event', 1322464145, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n........\n\n1 scenario (1 passed)\n6 steps (6 passed)\n0m5.129s', 0, 1322057539, 1320826448);
