(76, 0, 10, 'События: В любимые', '# encoding: utf-8\n# language: ru\nФункция: События: В любимые\nСобытие-рецензия типа "в любимые" содержит ссылку "это моя любимая книга", событие добавления автора, жанра и серии в любимые содержит аналогичную ссылку.\n\nПредыстория:\n    Допустим я вошёл как библиотекарь\n    \n  Сценарий: Добавляем серию в любимые\n    Если я добавил серию\n    И я добавил серию в любимые\n    То у меня на стене появляется любимая серия\n  \n  Сценарий: Добавляем автора в любимые\n    Допустим я вошёл как библиотекарь\n    Если я добавил автора\n    И я добавил автора в любимые\n    То у меня на стене появляется любимый автор\n    \n  Сценарий: Добавляем жанр в любимые\n    Допустим я вошёл как библиотекарь\n    Если я добавил жанр в любимые\n    То у меня на стене появляется любимый жанр', 'add_favorites_event', 1322464034, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..............\n\n3 scenarios (3 passed)\n13 steps (13 passed)\n0m12.619s', 0, 1321005863, 1320926580),
(77, 0, 10, 'Обновление рецензии', '# encoding: utf-8\n# language: ru\nФункция: Обновление рецензии\nЕсли юзер обновил уже существующую рецензию, или пытается оставить новую рецензию к книге, забыв, что уже оставлял, то\nесли время текущего обновления рецензии минус время последнего обновления больше Х дней – соотв. событие всплывает во всех лентах, где оно содержится.\n\nВ тех лентах, где события еще нет (например новые друзья) оно добавляется как новое независимо от даты обновления.\n\n\nПредыстория:\n      Допустим я вошёл как читатель\n    Допустим в базе есть книга\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: обновление рецензии\n	  Если я создаю рецензию к книге\n		То у друга на стене появляется рецензия\n		Если я обновляю рецензию к книге\n		То у друга на стене появляется обновленная рецензия', 'update_review_event', 1322464043, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n............\n\n1 scenario (1 passed)\n8 steps (8 passed)\n0m6.086s', 0, 1321005863, 1320826349),
(78, 0, 10, 'Комментарии и лайк чужих событий', '# encoding: utf-8\n# language: ru\nФункция: Комментарии и лайк чужих событий\nЛюбой залогиненный невандал может прокомментировать и/или залайкать следующие события в ленте юзера:\na. юзер поставил книгу на одну из полок\nb. юзер добавил книгу, автора или серию (завел новую карточку)\nc. юзер отредактировал книгу/автора/серию \nd. юзер загрузил книгу к карточке\ne. юзер получил медальку\nf. юзер зафрендил другого\ng. юзер добавил автора/жанр/серию в любимые\nh. пост юзера\ni. рецензия юзера\nПри этом в личную ленту комментатора такое событие попадает как новое (если до этого не было в ленте), и не меняет положения, если уже содержится в ленте комментатора.\nСамо событие в ленте комментатора содержит ту же информацию, что и в ленте автора события, но с соотв. оформлением ("%username2% прокомментировал/залайкал %event%")\nПредыстория:\n    Допустим я вошёл как читатель\n    Допустим в базе есть друг\n    Допустим друг у меня в поклонниках\n\nСценарий: Комментирование события\n		Если я добавил книгу\n		Если я откомментировал событие\n		То я должен увидеть комментарий к событию\n		Если друг откомментировал событие\n		То я должен увидеть комментарий друга к событию\n		Если друг ответил на комментарий\n		То я должен увидеть ответ на свой комментарий к событию', 'commentlike_event', 1322463700, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n..........P--\n\n(::) pending steps (::)\n\nfeatures/feeds/commentlike_event.feature:26:in `То я должен увидеть комментарий друга к событию''\n\n1 scenario (1 pending)\n10 steps (2 skipped, 1 pending, 7 passed)\n0m6.695s', 0, 1321005863, 1320838254),
(79, 0, 3, 'Добавление книги в любимые', '57567567', 'add_book_to_loved', 1321465095, 4, 'no file ../features/social/add_book_to_loved.feature', 1, 1320680975, 0),
(80, 0, 3, 'Посты', '# encoding: utf-8\n# language: ru\n\nФункция: Посты и комментарии\n	Чтобы обмениваться умными мыслями по поводу прочитанного\n	пользователи\n	могут оставлять и комментировать посты\n	\n	Предыстория:\n		Допустим я вошёл как читатель\n		\n	Сценарий: Добавление поста\n		Если я добавляю умный пост\n		То я должен увидеть свой пост\n\n	Сценарий: Вандал добавляет пост\n		Если я вошёл как вандал\n		То я не могу добавлять посты\n\n  Сценарий: Оставление комментария\n    Допустим в базе есть пост\n    Если я комментирую пост\n    То я должен увидеть свой комментарий', 'posts', 1322463625, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n...........\n\n3 scenarios (3 passed)\n10 steps (10 passed)\n0m10.461s', 0, 1321618394, 1321367110),
