(87, 0, 14, 'Статус работы над книгой', '# encoding: utf-8\n# language: ru\n\nФункция: Статус работы над книгой\n	Чтобы понять, в каком состоянии сейчас находится книга\n	пользователи могут: смотреть статус работы над книгой, вписываться в любой из статусов работы над книгой, выписываться.\n	Все события вписки и выписки пользователя из таблицы работы над книгой отражаются в ленте обсуждения качества книги.\n	\n\n	Сценарий: Просмотр статуса книги\n		Допустим я вошёл как читатель\n		И в базе есть другой читатель\n		И в базе есть книга\n		Если другой читатель ищет книгу\n		То я вижу что книгу ищут', 'book_status', 1322469707, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n.....\n\n1 scenario (1 passed)\n5 steps (5 passed)\n0m3.524s', 0, 1321620447, 1321611996),
(88, 0, 14, 'Задание статусов', 'Залогиненные пользователи не вандалы могут: смотреть статус работы над книгой, вписываться в любой из статусов работы над книгой, выписываться.\n\nВсе события вписки и выписки пользователя из таблицы работы над книгой отражаются в ленте обсуждения качества книги.\n	\nВ любой из статусов может вписаться произвольное число пользователей.\n\nБибер может принудительно выписать юзера из любого статуса.', 'statuses', 0, 0, '', 1, 0, 1321616124),
(89, 0, 14, 'Задание статусов', 'Залогиненные пользователи не вандалы могут: смотреть статус работы над книгой, вписываться в любой из статусов работы над книгой, выписываться.\r\n\r\nВсе события вписки и выписки пользователя из таблицы работы над книгой отражаются в ленте обсуждения качества книги.\r\n	\r\nВ любой из статусов может вписаться произвольное число пользователей.\r\n\r\nБибер может принудительно выписать юзера из любого статуса.', 'set_ocr_status', 0, 0, '', 1, 0, 0),
(90, 0, 14, 'Задание статусов', 'Залогиненные пользователи не вандалы могут: смотреть статус работы над книгой, вписываться в любой из статусов работы над книгой, выписываться.\r\n\r\nВсе события вписки и выписки пользователя из таблицы работы над книгой отражаются в ленте обсуждения качества книги.\r\n	\r\nВ любой из статусов может вписаться произвольное число пользователей.\r\n\r\nБибер может принудительно выписать юзера из любого статуса.', 'set_ocr_status.feature', 0, 0, '', 1, 0, 0),
