(99, 0, 14, 'Подтвержедение вклада пользователя', '# encoding: utf-8\n# language: ru\n\nФункция: Подтверждение вклада пользователя\n  Чтобы поощрять пользователей на пополнение фонда библиотеки\n  библиотекарь\n  может заносить пользователя в «аллею славы», подтверждая тем самым его вклад в работу над книгой\n\n  Предыстория:\n    Допустим в базе есть книга\n    И в базе есть читатель, который отсканировал книгу\n    Допустим я вошёл как библиотекарь\n\n  Сценарий: Подтверждение вклада читателя\n    Если я подтвержаю, что читатель отсканировал книгу\n    То вклад этого пользователя должен быть подтверждён\n    А пользователь должен попасть в аллею славы\n\n  Сценарий: Бибер выписывает читателя из OCR\n    Если я удаляю читателя из списка участников\n    То другие видят, что он не сканировал книгу\n\n  Сценарий: Читатель не может подтверждать вклад\n    Если я вошёл как читатель\n    То я не могу подтверждать вклад пользователей\n    И я не могу удалять вклад пользователей', 'biber_approves', 1322460252, 1, '\nDeprecated: Call-time pass-by-reference has been deprecated in /Library/Ruby/Gems/1.8/gems/cuke4php-0.9.10/lib/Cuke4Php.php on line 254\nUsing the default profile...\n....................\n\n3 scenarios (3 passed)\n17 steps (17 passed)\n0m8.871s', 0, 1322143330, 1322143330),
